import React from 'react';
import '../App.css';
import Cards from './Cards';
import HeroSection from './heroSection';
import Footer from './Footer';
import ProjectDets from './ProjectDets';
import Animator from './Animator/Animator';

function Home() {
    return (
        <>
            <HeroSection/>
            <Animator />
            <ProjectDets/>
            <Cards/>
            <Footer/>
        </>
    );
}

export default Home;
